import React from "react";
import "antd/dist/antd.css";
import styled from "styled-components";
import { Row, Col } from "antd";
import { FC } from "react";
import LeftSide from "./LeftSide";
import { Form, Input, Button, Checkbox } from "antd";

const SignUp: FC = () => {
  return (
    <>
      <Row>
        <Col span={6}>
          <LeftSide />
        </Col>
        <Col span={18}>
          <ContentBox>
            <TopLine />
            <SignUpBox>
              <FormContainer>
                <Form
                  name="normal_login"
                  className="login-form"
                  initialValues={{
                    remember: true,
                  }}
                >
                  <FormTitle>Sign up to Fly</FormTitle>
                  <Row justify="space-between">
                    <Col span={11}>
                      <Form.Item
                        label="Name"
                        labelCol={{ span: 24 }}
                        wrapperCol={{ span: 24 }}
                        rules={[
                          {
                            required: true,
                            message: "Please input your Username!",
                          },
                        ]}
                      >
                        <Input style={{ padding: "8px 12px" }} />
                      </Form.Item>
                    </Col>
                    <Col span={11}>
                      <Form.Item
                        label="Surname"
                        labelCol={{ span: 24 }}
                        wrapperCol={{ span: 24 }}
                        rules={[
                          {
                            required: true,
                            message: "Please input your Username!",
                          },
                        ]}
                      >
                        <Input style={{ padding: "8px 12px" }} />
                      </Form.Item>
                    </Col>
                  </Row>

                  <Form.Item
                    label="Email"
                    labelCol={{ span: 24 }}
                    rules={[
                      {
                        required: true,
                        message: "Please input your Email!",
                      },
                    ]}
                  >
                    <Input type="email" style={{ padding: "8px 12px" }} />
                  </Form.Item>

                  <Form.Item
                    label="Password"
                    labelCol={{ span: 24 }}
                    rules={[
                      {
                        required: true,
                        message: "Please input your Password!",
                      },
                    ]}
                  >
                    <Input
                      type="password"
                      placeholder="6+ characters"
                      style={{ padding: "8px 12px" }}
                    />
                  </Form.Item>
                  <Form.Item>
                    <Form.Item name="remember" valuePropName="checked" noStyle>
                      <Checkbox style={{ color: "#8C8C8C", fontSize: "12px" }}>
                        Creating an account means you’re okay with our Terms of
                        Service, Privacy Policy, and our default Notification
                        Settings.
                      </Checkbox>
                    </Form.Item>
                  </Form.Item>

                  <Form.Item>
                    <Button
                      style={{ width: "100%" }}
                      type="primary"
                      htmlType="submit"
                      className="login-form-button"
                    >
                      Create an account
                    </Button>
                  </Form.Item>
                </Form>
              </FormContainer>
            </SignUpBox>
          </ContentBox>
        </Col>
      </Row>
    </>
  );
};

export default SignUp;

const ContentBox = styled.section`
  height: 100vh;
  background: #e8e8e8;
`;

const TopLine = styled.div`
  margin-right: 42px;
  padding-top: 48px;
`;

const SignUpBox = styled.div`
  width: 100%;
  height: 82vh;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Member = styled.p`
  display: inline;
  text-decoration: none;
  font-family: Proxima Nova;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
  color: #000000;
  padding-right: 16px;
`;

const SignInBtn = styled.a`
  text-decoration: none;
  font-family: Proxima Nova;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
`;

const FormContainer = styled.div`
  width: 420px;
`;

const FormTitle = styled.p`
  font-family: Proxima Nova;
  font-weight: 400;
  font-size: 24px;
  line-height: 32px;
  text-align: center;
`;
